package com.tencent.lucasshi;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;

/**
 * Created by fzy on 17/9/3.
 */
public class Amazon_FindAllAnagram_done {
    private HashMap<Character, Integer> baseHash = new HashMap<>();
    private HashMap<Character, Integer> targetHash = new HashMap<>();

    public boolean checkEqual() {
        for (Character key : baseHash.keySet()) {
            if (!baseHash.get(key).equals(targetHash.get(key))) {
                return false;
            }
        }

        return true;
    }

    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();
        if (s.length() < p.length())
            return result;

        // build hashmap
        for (int i = 0; i < p.length(); i++) {
            if (!baseHash.containsKey(p.charAt(i))) {
                baseHash.put(p.charAt(i), 0);
            }
            baseHash.put(p.charAt(i), baseHash.get(p.charAt(i)) + 1);
        }

        // target
        for (int i = 0; i < p.length(); i++) {
            if (!targetHash.containsKey(s.charAt(i))) {
                targetHash.put(s.charAt(i), 0);
            }
            targetHash.put(s.charAt(i), targetHash.get(s.charAt(i)) + 1);
        }

        if (checkEqual()) {
            result.add(0);
        }
        // others
        for (int i = 1; i <= s.length() - p.length(); i++) {
            char deleteCharacter = s.charAt(i - 1);
            char addCharacter = s.charAt(i + p.length() - 1);
            targetHash.put(deleteCharacter, targetHash.get(deleteCharacter) - 1);
            if (!targetHash.containsKey(addCharacter)) {
                targetHash.put(addCharacter, 0);
            }
            targetHash.put(addCharacter, targetHash.get(addCharacter) + 1);

            if (checkEqual()) {
                result.add(i);
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Amazon_FindAllAnagram_done p = new Amazon_FindAllAnagram_done();
        String a = "";
        String b = "";

        p.findAnagrams(a, b);
    }
}
